public double slopeTo(Point that) {
        double xdiff = (double) (that.x - this.x);
        double ydiff = (double) (that.y - this.y);

        if (xdiff == 0 && ydiff == 0) {
            return Double.NEGATIVE_INFINITY;
        }

        if (xdiff == 0) {
            return Double.POSITIVE_INFINITY;
        }
        if (ydiff == 0) {
            return 0.0;
        }

        else {
            double slope =  ydiff /  xdiff;
            return slope;
        }

    }


    public int compareTo(Point that) {
        if (that.y < this.y) {
            return 1;
        }
        else if (that.y > this.y) {
            return -1;
        }
        else {
            if (this.x > that.x){
                return 1;
            }
            else if (this.x < that.x){
                return -1;
            }
            else {
                return 0;
            }
        }

    }

    private class SlopeOrder implements Comparator<Point> {
        public int compare(Point p1, Point p2) {
            double a = Point.this.slopeTo(p1);
            double b = Point.this.slopeTo(p2);
            int diff = (int) (a-b);
            if (a < b) {
                return -1;
            }
            else if (a == b) {
                return 0;
            }
            else 
                return 1;
        }
    }

import java.util.Arrays;
import java.util.Scanner;

public class MissedCard {

    private static int number = 0;

    public static void main(String[] args) {
        System.out.println(num(calculating()));

    }

    private static int[] calculating() {
        Scanner sc = new Scanner(System.in);
        number = sc.nextInt();
        int[] cards = new int[number];
        for (int i = 0; i < number - 1; i++)
            cards[i] = sc.nextInt();
        Arrays.sort(cards);
        return cards;
    }

    private static int num(int[] arr) {
        for (int i = 0; i < number - 1; i++) {
            if (arr[i] != i)
                return i--;
        }
        return number;
    }
}

