public class RandomizedDeque<Item> implements Iterable<Item> {

    private int size;
    private Node first, last;
    private Item[] objects;

    private class Node {
        private Item item;
        private Node prev, next;

        public Node(Item item) {
            this.item = item;
            prev = null;
            next = null;
        }
    }

    public RandomizedDeque() {
        objects = (Item[]) new Object[1];
        size = 0;
    }

    public boolean isEmpty(){
        return size == 0;
    }
    // —á–∏ –ø–æ—Ä–æ–∂–Ω—è?

    public int size(){
        return size;
    }
    // –∫—ñ–ª—å–∫—ñ—Å—Ç—å –µ–ª–µ–º–µ–Ω—Ç—ñ–≤

    public void enqueue(Item item) {
        if (item == null)
            throw new NullPointerException();
        if (size == objects.length)
            increase(size * 2);
        objects[size] = item;
        size++;
    }
    // –¥–æ–¥–∞—Ç–∏ –µ–ª–µ–º–µ–Ω—Ç

    public Item dequeue() {
        if (isEmpty())
            throw new NoSuchElementException();
        StdRandom.shuffle(objects);
        Item item = objects[size - 1];
        objects[size - 1] = null;
        size--;

    }
    // –≤–∏–¥–∞–ª–∏—Ç–∏ —ñ –ø–æ–≤–µ—Ä–Ω—É—Ç–∏ –≤–∏–ø–∞–¥–∫–æ–≤–∏–π –µ–ª–µ–º–µ–Ω—Ç

    public Item sample() {
        if (isEmpty())
            throw new NoSuchElementException();
    }
    // –ø–æ–≤–µ—Ä–Ω—É—Ç–∏ –∞–ª–µ –Ω–µ –≤–∏–¥–∞–ª–∏—Ç–∏ –≤–∏–ø–∞–¥–∫–æ–≤–∏–π –µ–ª–µ–º–µ–Ω—Ç

    private void increase(int newsize) {
        if (newsize >= 1) {
            Item[] newobjects = (Item[]) new Object[newsize];
            for (int i = 0; i < size; i++) {
                newobjects[i] = objects[i];
                objects[i] = null;
            }
            objects = newobjects;
        }
    }

    @Override
    public Iterator<Item> iterator() {
        return null;
    }

}

double sin(double x, double eps)
{
  double a = x;
  double s = a;
  int k = 1;
  double n = 1;
  while (a > eps || -a < -eps)
  {
    n = -x * x / (2 * k * (2 * k + 1));
    a *= n;
    s += a;
    k++;
  }
  return s;
}

