double exp(double x, int n)
{
  double a = 1;
  double s = a;
  for (int k = 1; k <= n; k++)
  {
    a *= x / k;
    s += a;
  }
  return s;
}

double exp(double x, double eps)
{
  double a = 1;
  double s = a;
  int k = 1;
    while(a > eps)
    {
    a *= x / k;
    s += a;
    k++;
  }
  return s;
}

