public class StudentsGrades {

    private int[] marks;

    private int maxMark = 0, minMark = 100;
    private double midMark = 0;

    private int lowerCounter = 0, higherCounter = 0;

    private int vidminno = 0, dobre = 0, zadovilno = 0, nezadovilno = 0;

    StudentsGrades() {
        marks = new int[10];
    }

    StudentsGrades(int size) {
        marks = new int[size];
    }

    StudentsGrades(StudentsGrades sg) {
        int l = sg.marks.length;
        marks = new int[l];
        for (int i = 0; i < l; i++)
            marks[i] = sg.marks[i];
        maxMark = sg.maxMark;
        minMark = sg.minMark;
        midMark = sg.midMark;
    }

    public int getLowerCounter() {
        return lowerCounter;
    }

    public int getHigherCounter() {
        return higherCounter;
    }

    private void higherOrLower() {
        for (int i = 0; i < marks.length; i++)
            if (marks[i] < midMark)
                lowerCounter++;
            else if (marks[i] > midMark)
                higherCounter++;
    }

    public int getVidminno() {
        return vidminno;
    }

    public int getDobre() {
        return dobre;
    }

    public int getZadovilno() {
        return zadovilno;
    }

    public int getNezadovilno() {
        return nezadovilno;
    }

    private void levelOfGrade() {
        for (int i = 0; i < marks.length; i++)
            if (marks[i] >= 91 && marks[i] <= 100)
                vidminno++;
            else if (marks[i] >= 71 && marks[i] <= 90)
                dobre++;
            else if (marks[i] >= 60 && marks[i] <= 70)
                zadovilno++;
            else if (marks[i] >= 0 && marks[i] <= 59)
                nezadovilno++;
    }

    public int getMaxMark() {
        return maxMark;
    }

    public int getMinMark() {
        return minMark;
    }

    public double getMidMark() {
        return midMark;
    }

    private void computeMidMark() {
        for (int i = 0; i < marks.length; i++)
            midMark += (double)marks[i];
        midMark /= marks.length;
    }

    public int[] getMarks() {
        int l = marks.length;
        int[] marksCopy = new int[l];
        for (int i = 0; i < l; i++)
            marksCopy[i] = marks[i];
        return marksCopy;
    }

    public void setMarks(int[] input) {
        int l = input.length;
        marks = new int[l];
        for (int i = 0; i < l; i++)
            if (input[i] >= 0 && input[i] <= 100) {
                marks[i] = input[i];
                if (marks[i] > maxMark)
                    maxMark = marks[i];
                if (marks[i] < minMark)
                    minMark = marks[i];
            }
            else if (input[i] < 0) {
                marks[i] = 0;
                minMark = 0;
            }
            else if (input[i] > 100) {
                marks[i] = 100;
                maxMark = 100;
            }
        computeMidMark();
        higherOrLower();
        levelOfGrade();
    }

    public void setMark(int mark, int position) {
        if (position >= 0 && position < marks.length) {
            marks[position] = mark;
            if (marks[position] > maxMark)
                maxMark = marks[position];
            if (marks[position] < minMark)
                minMark = marks[position];
            computeMidMark();
        }
    }

    public String toString() {
        String result = new String();
        for (int i = 0; i < marks.length - 1; i++)
            result += marks[i] + ", ";
        result += marks[marks.length - 1];
        return result;
    }

}

